fields.formula:
if(
  any(totext(lookup("Related projects", "Status")) = "In progress"), 
  True, 
  if(
    any(totext(lookup("Related lead work", "Status")) = "Planning and design"),
    True,
    if(
      any(totext(lookup("Related lead work", "Status")) = "In progress"), 
      True, 
      False
    )
  )
)

if(
  any(totext(lookup("Related projects", "Status")) = "Planning and design"), 
  True, 
  if(
    any(totext(lookup("Related projects", "Status")) = "In progress"),
    True,
    False
  )
)

add(
  when_empty(
    sum(
      multiply(
        multiply(
          lookup("Freelancers", "Hourly rate"), 
          field("Estimated working days")
        ), 
        8
      )
    ), 
    0
  ), 
  when_empty(
    sum(
      multiply(
        multiply(
          lookup("Project lead", "Hourly rate"), 
          field("Estimated working days")
        ), 
        8
      )
    ), 
    0
  )
)

minus(
  add(
    date_diff(
      "day", 
      field("Kickoff date"), 
      field("Due date")
    ), 
    1
  ), 
  if(
    add(
      date_diff(
        "day", 
        field("Kickoff date"), 
        field("Due date")
      ), 
      1
    ) < 7, 
    0, 
    multiply(
      tonumber(
        left(
          totext(
            divide(
              add(
                date_diff(
                  "day", 
                  field("Kickoff date"), 
                  field("Due date")
                ), 
                1
              ), 
              7
            )
          ), 
          minus(
            search(
              totext(
                divide(
                  add(
                    date_diff(
                      "day", 
                      field("Kickoff date"), 
                      field("Due date")
                    ), 
                    1
                  ), 
                  7
                )
              ), 
              "."
            ), 
            1
          )
        )
      ), 
      2
    )
  )
)
